import React, {Component} from 'react';

const rightsidebar = ({likecontent,galleryimages,trendsdata}) =>{
  const style = {
    display:"flex",
    flexdirection: "row"  
  };
  return(
    <div class="rightcolumn">
      <div className="searchForm">
          <form>
            <input
              placeholder="Search for..."value="search"/>
            <button type="submit" value="Enter"><i class="fa fa-search">Enter</i></button>
          </form>
      </div>

      <div  className="card">
          {
            galleryimages.map(item => (
              <div>
                    <span style={{style}}><img style={{width:"20px"}} src = {item.image} alt=""/></span>
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            likecontent.map(item => (
              <div >
                    <div class="fakeimg"><p><img src={item.image}/>     {item.name}<br/>{item.tweetid}</p></div>      
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            trendsdata.map(item => (
              <div >
                    <div class="fakeimg"><p><img src={item.countryname}/>     #{item.name}<br/>{item.tweetid}</p></div>      
              </div>
              ))
          }    
      </div>
      <div class="card">
        <h3>Trends for you</h3>
        <p>Some text..</p>
      </div>
    </div>
  );
}
export default rightsidebar


